import React, {Component} from 'react';
import {quizzes, users} from '../examples';

class ListQuiz extends Component {

    render() {
      return (
        <>
        <h1>List of Quiz</h1>
        <div>
          {quizzes.map((object, index) =>
            <img src={object.icon} />
          )}
        </div>
        </>
        
      );
    }
}

export {ListQuiz};
